import React from 'react';
import './Cart.css';

const cart = (props) => {
    const cart = props.cart;
    return (
        <div>
            <h4>Order Summary: </h4>
            <p>Items Ordered: {cart.length}</p>
        </div>
    );
};

export default cart;
